```&lt;div class="Subscribesectioninner"  style="background : {{ module.background_color.color }}"&gt;
{#   {% if  module.form_title %} #}
  &lt;div class="Subscribetitle  bold"&gt;
    &lt;h3&gt;{{ module.form_title }}&lt;/h3&gt;
  &lt;/div&gt;
{#   {% endif %} #}
  {#{% if module.form_content  %} #}
  &lt;div class="Subscribecontent pt15  normal font18 lh15"&gt;
    {{ module.form_content }}
  &lt;/div&gt;
 {# {% endif %} #}
  &lt;div class="Subscribeform pt35"&gt;
    {% form
	                form_to_use="{{ module.form.form_id }}"
	                response_response_type="{{ module.form.response_type }}"
	                response_message="{{ module.form.message }}"
	                response_redirect_id="{{ module.form.redirect_id }}"
	                response_redirect_url="{{module.form.redirect_url}}"
	                gotowebinar_webinar_key="{{ module.form.gotowebinar_webinar_key }}"
              %}
  &lt;/div&gt;
  {% if module.privacy_policy_content  %}
  &lt;div class="Subscribetext pt15 light"&gt;
    {{ module.privacy_policy_content }}
  &lt;/div&gt;
  {% endif %}
&lt;/div&gt;
&lt;style&gt;
  .Subscribetitle h3 { color : {{ module.form_title_style.color.color }}; 
    font-family :{% if module.form_title_style.want_default_font_family_ %} "Sofia Pro"
      {% else  %} {{ module.form_title_style.font_family.font }}
      {% endif %}
  }
  .Subscribecontent p { color : {{ module.form_content_style.color.color }};
    font-family :{% if module.form_content_style.want_default_font_family_ %}
      "Sofia Pro"
      {% else %}
      {{ module.form_content_style.font_family.font }}
      {% endif %}
  }
  .Subscribeform input[type=email] {
    background: {{ module.form_input_field_style.background_color.color }};
    color: {{ module.form_input_field_style.color.color }};
    font-family: {% if module.form_input_field_style.want_default_font_family_ %}
      "Sofia Pro"
      {% else %}
      {{ module.form_input_field_style.font_family.font }}
      {% endif %}

  }
  .Subscribeform .hs_submit.hs-submit input[type="submit"] {
    color: {{ module.form_submit_style.color.color }};
    background: transparent linear-gradient(95deg,{{ module.form_submit_style.background_color.color }} 0%,{{ module.form_submit_style.gradient_background_color_2.color }} 34%,{{ module.form_submit_style.gradient_background_color_3.color }} 64%,{{ module.form_submit_style.gradient_background_color_4.color }} 100%) 0% 0% no-repeat padding-box !important;
    font-family: {% if module.form_submit_style.want_default_font_family_ %}
      "Sofia Pro"
      {% else %}
      {{ module.form_submit_style.font_family.font }}
      {% endif %};
  }
  .Subscribetext p {
    color: {{ module.privacy_policy_style.color.color }};
    font-family: {% if module.privacy_policy_style.want_default_font_family_ %}
      "Sofia Pro"
      {% else %}
      {{ module.privacy_policy_style.font_family.font }}
      {% endif %}
  }
  .Subscribetext p a{ color : {{ module.privacy_policy_style.link_color.color }};}
&lt;/style&gt;```
